description:
Five years after the raging success of I Dream of Jenna, this witty, sexy sequel finds our magically delicious heroine bored by routine and desperate for a little action. Inspired by the saucy writings of a nineteenth century Marquis, she sets out on a mission to enchant her master and his friends into the most delectable gratification they've ever known. Determined to win her master's attention, she transforms herself into an exotic, untamed beauty (Belladona) with a wiggle of her nose and takes seduction to an entirely new level. Using all means at her disposal - including an irrepressible libido, a sprightly imagination, a variety of toys, and an onslaught of her most erotic playmates - Jenna leads the all-star cast through seven energetic scenes charged with the sexuality that's made her legendary.

